waves.point_eqs_str:
n=sample*6.283;
step=sample*128;
step2=(int(step)/128)*6.283;
step3=(step - int(step));
tm = t1 * 6.283 - 3.1415;

//star lines
xp=sin(step2) * 0.4;
yp=cos(step2) * 0.4;
zp=sin(step2*19.3)*3.1415 + step3*0.35 - tm;
zp=if(below(zp,-3.1415), zp+6.283 , zp);


//kill stray lines from front to back
a=if(below(step3,0.36) , 0 , 1);
a=if(above(step3,0.64) , 0 , a);
a=if(below(zp,-3) , 0 , a);
a=if(above(zp,3) , 0 , a);

//a=a*(zp/6.08);
a=a*(1-step3);
a=min( max(a,0) , 1);


zp=zp*2 - 3.1415;

//zp=if(below(zp,-3.1415), zp+6.283 , zp);

a=a * (1-(zp+2.1415)/6.283);

a=if(below(zp,-1.5) , 0 , a);
a=if(above(zp,4.0) , 0 , a);

//shift back when pointing away from camera
zp=zp-q4*2;

//z rotation
sang=sin(q1);cang=cos(q1);
xn=xp*sang + yp*cang;
yn=xp*cang - yp*sang;
zn=zp;
xp=xn;yp=yn;zp=zn;

//y rotation;
sang=sin(q2);cang=cos(q2);
xn=xp*sang + zp*(cang);
yn=yp;
zn=xp*cang - zp*sang;
xp=xn;yp=yn;zp=zn;

//x rotation;
sang=sin(q3);cang=cos(q3);
xn=xp;
yn=yp*sang + zp*cang;
zn=yp*cang - zp*sang;
xp=xn;yp=yn;zp=zn;



zp=zp*2+1.55;

//near clipping plane
a=a*above(zp,0.75);
//a=a*below(zp,8.55);

x=xp/zp+ 0.5;
y=yp/zp * 1.3 + 0.5;

a=a*0.5

